    <div class="card6__title">Cameron Williamson</div>
    <div class="card6__subtitle">Web Development</div>
    <div class="card6__wrapper">
        <button class="card6__btn">Button</button>
        <button class="card6__btn card6__btn-solid">Button</button>
    </div>
</div>
           </div>

        </div>
    )
}

export default Lawyerenter
